import React from 'react';

const ItemCart = ({item}) => {
    return (
        <div>
            <thead>
                <tr>
                    <th scope="col">Producto:</th>
                    <th scope="col">Cantidad pedida:</th>
                    <th scope="col">Precio:</th>
                </tr>
            </thead>
            <td>{item.name}</td> 
            <td>{item.amount}</td> 
            <td>${item.price}</td>
        </div>
    );
}

export default ItemCart;
